import React, { useEffect } from "react";
import { useHistory } from "react-router-dom";
import image from "../../../logos/dos.jpg"; 
import FlavorForm from "../../Formulaire";


const pst = window.location.search;  




console.log(pst);
function Cartesanimlign() {
  


   

    let history = useHistory();

 

    useEffect(() => {
      if (!localStorage.getItem("accessToken")) {
        history.push("/login");
      }
    }, []);
    

    return (
     
      <div  className="background">



              
              <div className="navigationquestion">   <button onClick={() => {
                history.push(`/form`);
              } }> Vers autres models </button>
              
              
              
              </div>



            



      <div  className="ajustementenligne">
      
  
     <div className="question">
     

      <div className="test1">


      <span > 

      
      <FlavorForm /> 
      <button value="OK" onClick={() => {
                history.push(`/anim2`);
              } }> OK </button>

        
        </span>        </div>

  
      <div className="test2">


    
<div className="animquestion">
<img
          src={image}
          alt="Carte"
        />





  
        <img
          src={image}
          alt="Carte"
        />


        <img
          src={image}
          alt="Carte"
        />




        <img
          src={image}
          alt="Carte"
        />





        <img
          src={image}
          alt="Carte"
        />   
      
      </div>
      </div>
      
      </div>
    
      </div>
      
      
     
      
      <div className="navigationquestion">   <button onClick={() => {
                history.push(`/choix`);
              } }> Choix d'autres cartes </button>
              
              
              
              </div> </div>
    );
  }
  
  export default Cartesanimlign;
